import Header from "./header";
import Footer from "./footer";
import Note from "./Note.jsx";
import notes from "../notes";
import CreateArea from "./CreateArea";



function App(){


function addNote(){}



    return <div>
        <Header />
        <CreateArea onAdd={addNote}/>
        {notes.map((noteItem) => {
    return <Note 
    key={noteItem.key}
    title={noteItem.title}
    content={noteItem.content}
    />
}
            
        )};
        <Footer />
    </div>
}

export default App;
